import React, { Component } from 'react';

class Parent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      parentMessage: '',
    };
  }

  changeMsg = (event) => {
    this.setState({
      parentMessage: event.target.value,
    });
  };

  render() {
    return (
      <div>
        <input
          type='text'
          value={this.state.parentMessage}
          onChange={this.changeMsg}
        />
      </div>
    );
  }
}

export default Parent;
